import { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import Header from "../components/Header";

const LookData = () => {
    let params = useParams()
    const [state, setState] = useState()
    console.log(params.id);

    const LookData = async () => {
        const LookDataData = await axios({
            url: `http://localhost:8000/patients/${params.id}`,
            method: "get"
        })
        console.log(LookDataData);
        if (LookDataData.status == 200) {
            setState(LookDataData.data)
        }
    }

    useEffect(() => {
        LookData()
    }, [])

    return (
        <div className="DataLook">
            <Header />
            <div style={{ padding: "35px 35px" }} className="title-block">
                <h2>Данные пациентов</h2>
            </div>

            {state != null ? <>
                <div className="inp-block">
                    <div className="box-style">
                        <label for="">Эритроциты</label>
                        <input onChange={(e) => setOne(e.target.value)} className="flex" type="text" placeholder="Placeholder content" />
                    </div>
                    <div className="box-style">
                        <label for="">Гемоглобин</label>
                        <input onChange={(e) => setTwo(e.target.value)} className="flex" type="text" name="" placeholder="Placeholder content" />
                    </div>
                </div>
            </> : <><center>loading</center></>}
            <div className="section-lookdata"></div>

        </div>
    );
}

export default LookData
